import React from 'react';
import '../App.css';
import { Button } from './Button';
import './Values.css';

function ValuesSection() {
  return (
    <div className='values-container'>
    <div className='values-text-container'>


    <h1>Values</h1>
    <br />
    <p><b>Innovation</b> : Passion for technology and how it can improve businesses and lives.  </p>
    <br />
    <p><b>Simplicity</b> : Always challenge to find the most simple solutions to improve understanding and ease-of-use.  </p>
    <br />
    <p><b>Ethical</b> : Approach business with clear ethical principles and engage in disuscussions of Ethics.  </p>
    <br />
    <p><b>Action</b> : Focus on taking practical steps using a methodical approaches.  </p>
    </div>
    </div>


  );
}

export default ValuesSection;
